lendid image galleries on your website with this simple drag and drop Galley Block. You can display a beautiful gallery of images on your website.'=>'Покажите великолепные галереи изображений на своем веб-сайте с помощью этого простого перетаскивания блока Галерея. Вы можете разместить на своем сайте красивую галерею изображений.','Ibtana Gallery'=>'Галерея Ibtana','Inserting a customizable Google map is now easy with Google Map Block. You can include a google map and enter the location name, address with functionality to zoom in and zoom out.'=>'Вставить настраиваемую карту Google теперь легко с помощью Google Map Block. Вы можете включить карту Google и ввести название местоположения, адрес с возможностью увеличения и уменьшения масштаба.','Google Map'=>'Карта Google','Page Title Block gives you the flexibility to place the title of the page and display it on the web page.'=>'Блок заголовка страницы дает вам возможность разместить заголовок страницы и отобразить его на веб-странице.','Page Title'=>'Заголовок страницы','Disable File Generation'=>'Отключить создание файла','Inadequate File Permission'=>'Недостаточное разрешение файла','Enable File Generation'=>'Включить создание файлов','Enabling this option will generate CSS files for Ibtana WordPress Website Builder styling instead of loading the CSS inline on page.'=>'Включение этой опции приведет к созданию файлов CSS для стиля Ibtana WordPress Website Builder вместо загрузки встроенного CSS на странице.','CSS File Generation'=>'Создание файла CSS','The Button block allows you to add buttons linking to other pages on your site with advanced functionality for changing colors, font size, adding opacity, and more.'=>'Блок Кнопка позволяет добавлять кнопки, ссылающиеся на другие страницы вашего сайта, с расширенными функциями изменения цвета, размера шрифта, добавления непрозрачности и многого другого.','Button'=>'Кнопка','WordPress Theme bundle is our best offer wherein we offer all our premium themes in a single package at a very good price. We at VWThemes, strongly believe in serving our customers.'=>'Пакет тем WordPress — наше лучшее предложение, в котором мы предлагаем все наши темы премиум-класса в одном пакете по очень хорошей цене. Мы в VWThemes твердо верим в обслуживание наших клиентов.','WP Theme Bundle'=>'Пакет тем WP','See Demos »'=>'Смотрите демонстрации »','Wish to see some real design implementations with these blocks?'=>'Хотите увидеть реально реализованные проекты с этими блоками?','Ibtana WordPress Website Builder comes with 15+ blocks through which you can easily create your templates using HTML and WordPress knowledge. If you want you can also try our themes package with pre-build landing and internal pages. We have different category light weight themes targeted with category wise landing and internal pages, installed through setup wizard.'=>'Ibtana WordPress Website Builder включает более 15 блоков, с помощью которых вы можете легко создавать свои шаблоны, используя знания HTML и WordPress. Если вы хотите, вы также можете попробовать наш пакет тем с готовыми целевыми и внутренними страницами. У нас есть легкие темы различных категорий, ориентированные на целевые и внутренние страницы по категориям, которые устанавливаются с помощью мастера установки.','How to use Ibtana WordPress Website Builder'=>'Как использовать конструктор сайтов WordPress Ibtana','Know More »'=>'Узнать больше »','Get 3+ of  professionally designed pre-built FREE starter templates built using Gutenberg, Ibtana WordPress Website Builder and the VW Themes. These can be imported in just a few clicks. Tweak them easily and build awesome websites in minutes!'=>'Получите более 3 профессионально разработанных готовых БЕСПЛАТНЫХ стартовых шаблонов, созданных с использованием Gutenberg, Ibtana WordPress Website Builder и VW Themes. Их можно импортировать всего за несколько кликов. Легко настройте их и создавайте потрясающие веб-сайты за считанные минуты!','Ready-to-use Full Demo Websites - '=